import { Layout, Page, EmptyState } from "@shopify/polaris";

const img =
  "https://www.google.com/url?sa=i&url=https%3A%2F%2Fscratchpad.fandom.com%2Fwiki%2FKaren_(SpongeBob_SquarePants)&psig=AOvVaw2qTEJG6k1OS7lQejTUNGy1&ust=1586890741934000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJis9-qK5ugCFQAAAAAdAAAAABAD";

const Index = () => (
  <div>
    <Page>
      <Layout>
        <EmptyState
          heading="Discount your products temporarily"
          action={{
            content: "Select products",
            onAction: () => console.log("clicked"),
          }}
          img={img}
        >
          <p>Sample app using Rect and Next.js</p>
        </EmptyState>
      </Layout>
    </Page>
  </div>
);

export default Index;
